    public static void testMyJsonResolver(String json){
        long start = 0;
        long end = 0;
        System.out.print("Json字符长度："+json.length());
        long time = 0;
        for(int i =0;i<COUNT;i++) {
            start = System.currentTimeMillis();
            Json.json2Object(json);
            end = System.currentTimeMillis();
            time = time+(end-start);
        }
        System.out.println(" 耗时："+time);
    }

    public static void testFastJsonResolver(String json){
        long start = 0;
        long end = 0;
        System.out.print("Json字符长度："+json.length());
        long time = 0;
        for(int i =0;i<COUNT;i++) {
            start = System.currentTimeMillis();
            JSON.parse(json);
            end = System.currentTimeMillis();
            time = time+(end-start);
        }
        System.out.println(" 耗时："+time);
    }

    public static void testGoJsonResolver(String json){
        long start = 0;
        long end = 0;
        Gson gson = new Gson();
        System.out.print("Json字符长度："+json.length());
        long time = 0;
        for(int i =0;i<COUNT;i++) {
            start = System.currentTimeMillis();
            gson.fromJson(json,Map.class);
            end = System.currentTimeMillis();
            time = time+(end-start);
        }
        System.out.println(" 耗时："+time);
    }

